import React from 'react';
import { withRouter} from 'react-router-dom'
import  PropTypes  from 'prop-types'

import doggo from './img/doggo.jpg';
import postersample from './img/poster1.jpg'
import './postersamples.css';



class PosterSamples extends React.Component{


  render(){
    return <img className = 'postersamples' src = {this.props.posterselection} />
  }
}



export default withRouter(PosterSamples);
